contracts/TestAdjusted.sol.content:
pragma solidity ^0.8.4;

contract Adjusted {

    uint min = 10000;

    function AdjustedAmount (uint _a) external view returns (uint) {
        require (_a >= min, "Amount must be not smaller than 10000");
        uint res = (_a * 25) / 10000;
        return res;
    }
}

